import React from 'react'
import {connect} from 'react-redux'

//we get the profile page of the user in Account function
function Account(props){
    console.log("Account-->User Profile",props)
    return(
        <div>
            {/* All these response we get from the server */}
            <h2>User Account Information</h2>
            <h2>UserID:{props.user._id}</h2>
            <h2>UserName:{ props.user.username }</h2>
            <h2>UserEmail:{ props.user.email }</h2>
            <h2>Password:{props.user.password}</h2>
            {/* <h2>Token Info:{props.user.tokens[token]}</h2> */}
        </div>
    )
}

//now we need to read the state value from the redux store
const mapStateToProps=(state)=>{
    return{
        user:state.user
    }
}

export default connect(mapStateToProps)(Account)
